import React from 'react';
import { 
    IonBackButton,
    IonButtons,
    IonIcon
} from '@ionic/react';
import { returnDownBack } from 'ionicons/icons';


const BackBtn: React.FC = () => (
    <IonButtons slot="end">
        <IonBackButton text="Back">
            <IonIcon slot="icon-only" icon={returnDownBack}></IonIcon>
        </IonBackButton>
    </IonButtons>
)

export default BackBtn;
